import React from "react";
import VideoCard from "./VideoCard";
import "./Recommended.css";

function RecommendedVideos() {
  return (
    <div className="recommendedVideos">
      <h2> this is the video section</h2>
      <div className="recommendedVideos__videos">
        <VideoCard
          title="Become a web developer in 10 minutes | 2019/09/23"
          views="2.3M views"
          timestamp="3 days ago"
          channelImage="https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.pinimg.com%2Foriginals%2Fd4%2F94%2F76%2Fd49476e6169ae02dd0eea882b1443586.jpg&imgrefurl=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F742179213586244100%2F&tbnid=j4hA63ow5rdS5M&vet=12ahUKEwiWv9Hp3cvyAhUH0oUKHTOgD4gQMygGegUIARDYAQ..i&docid=PArfLRMNGonroM&w=2833&h=1750&q=youtube%20thumbnail&ved=2ahUKEwiWv9Hp3cvyAhUH0oUKHTOgD4gQMygGegUIARDYAQ"
        />
        <VideoCard />
        <VideoCard />
        <VideoCard />
        <VideoCard />
        <VideoCard />
        <VideoCard />
      </div>
    </div>
  );
}

export default RecommendedVideos;
